using System;

namespace VenuePlus.Helpers;

public static class VImages
{
    public const string DefaultVenueLogoBase64 = "data:image/png;base64,";
    internal static string GetDefaultVenueLogoBase64Raw()
    {
        var raw = DefaultVenueLogoBase64;
        if (string.IsNullOrWhiteSpace(raw)) return string.Empty;
        var idx = raw.IndexOf("base64,", StringComparison.OrdinalIgnoreCase);
        if (idx >= 0) return raw[(idx + 7)..].Trim();
        return raw.Trim();
    }
}
